import React, { useState } from 'react';
import { demoData } from '../data/demo.js';

const ProfilePage = () => { 
    const [profileData] = useState(demoData); 
    if (!profileData) { return <div className="text-center p-8">Error: Profile data could not be loaded.</div>; } 
    const { userProfile, dailyGoals, weightLog } = profileData; 
    return (
        <div className="container mx-auto p-8">
            <div className="bg-white shadow-xl rounded-lg p-8">
                <div className="flex items-center space-x-6 mb-8">
                    <div className="bg-green-500 text-white w-24 h-24 rounded-full flex items-center justify-center text-4xl font-bold">{userProfile.username.charAt(0).toUpperCase()}</div>
                    <div><h2 className="text-4xl font-extrabold text-green-700">{userProfile.username}</h2><p className="text-gray-600">{userProfile.email}</p></div>
                </div>
                <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8 text-center">
                    <div className="bg-green-50 p-4 rounded-lg"><p className="text-gray-500 text-sm">Current Weight</p><p className="text-2xl font-bold text-green-800">{userProfile.currentWeight.value} {userProfile.currentWeight.unit}</p></div>
                    <div className="bg-green-50 p-4 rounded-lg"><p className="text-gray-500 text-sm">Goal Weight</p><p className="text-2xl font-bold text-green-800">{userProfile.goalWeight.value} {userProfile.goalWeight.unit}</p></div>
                    <div className="bg-green-50 p-4 rounded-lg"><p className="text-gray-500 text-sm">Height</p><p className="text-2xl font-bold text-green-800">{userProfile.height.value} {userProfile.height.unit}</p></div>
                </div>
                <div className="mb-8"><h3 className="text-2xl font-semibold text-gray-700 mb-4 border-b pb-2">Daily Goals</h3><div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-gray-800"><div className="p-2"><strong>Calories:</strong> {dailyGoals.calories} kcal</div><div className="p-2"><strong>Protein:</strong> {dailyGoals.protein}g</div><div className="p-2"><strong>Carbs:</strong> {dailyGoals.carbohydrates}g</div><div className="p-2"><strong>Fats:</strong> {dailyGoals.fats}g</div></div></div>
                <div><h3 className="text-2xl font-semibold text-gray-700 mb-4 border-b pb-2">Weight History</h3><ul className="space-y-2">{weightLog.map((entry, index) => (<li key={index} className="flex justify-between bg-gray-50 p-3 rounded-md"><span className="text-gray-600">{new Date(entry.date).toLocaleDateString()}</span><span className="font-bold text-gray-800">{entry.weight} kg</span></li>))}</ul></div>
            </div>
        </div>
    ); 
};

export default ProfilePage;
